<script>
jQuery(document).ready(function($){
	
	var cx = 251;
	var cy = 315;
	
	updateRange();
	
	
	$('.airport').on('click',function(){
		$('.airport').removeClass('active');
		$(this).addClass('active');
		cx = $(this).find('circle').attr('cx');
		cy = $(this).find('circle').attr('cy');
         	            
		updateRange();		
	});
	
	function updateRange(){
		if($('#wind_selector').val() == 'nowind'){
			var wind = 0;
		} else if($('#wind_selector').val() == 'low'){
			var wind = 50;
		} else if($('#wind_selector').val() == 'medium'){
			var wind = 100;
		} else {
			var wind = 150;
		}
		var tasoriginal = '<?php the_field('ac_cruising_speed'); ?>';
		tasoriginal = 411;
		var tas = parseInt(tasoriginal) / 1000;
		var origin = 100;
		
		if($('#cabin_selector').val() == 'fuel'){
			var rangeOriginal = '<?php the_field('ac_range'); ?>';
		} else {
			var rangeOriginal = '<?php the_field('ac_range_full_cabin'); ?>';
		}
		
		var rangeOriginal = 1800;
		
		var projectionErrorMultiplier = 1.91
		
		var range = projectionErrorMultiplier*rangeOriginal/1000;
		var hours = (rangeOriginal/tas)/1000;
			  
		var north = parseInt(range*origin);
		var east = parseInt(range*origin);
		var south = parseInt(range*origin);
		var west = parseInt(range*origin);
			 
		var northeast = parseInt(north+east)/2;
		var southeast = parseInt(south+east)/2;
		var southwest = parseInt(south+west)/2;
		var northwest = parseInt(north+west)/2;
		
		var mx = parseInt(cx) + parseInt(hours * wind * projectionErrorMultiplier / 10);
		var my = parseInt(cy) - parseInt(north);
		
		console.log(cx, cy, hours, wind, mx, my, north, east, south, west);
					  
		constructed = 'm'+mx+','+ my +'';
		// CURVE TOP TO RIGHT
		constructed+= 'c '+ 0 +',0 '+northeast*.97+',0 '+east+','+north;
		// CURVE RIGHT TO BOTTOM
		constructed+= 'c 0,0 0,'+southeast*1.03+' -'+east+','+south+' ';
		// CURVE BOTTOM TO LEFT
		constructed+= 'c 0,0 -'+southwest*1.03+',0 -'+west+',-'+south+' ';
		// CURVE LEFT TO TOP
		constructed+= 'c 0,-'+ 0+' 0,-'+northwest*.97+' '+west+',-'+north+'z';
		 
		$('#range').attr('d', constructed);       
				
	}
	
	$('.map-options-selectors select').on('change', function(){		
		updateRange();							
	});
	
});
</script>

